import React, {Component} from "react";
import PropTypes from 'prop-types';
import {Upload, Modal, message} from 'antd';
import {PlusOutlined} from '@ant-design/icons';
import {reqDeleteImage} from "../../../../api";
import {BASE_IMG_URL} from "../../../../utils/constants";

function getBase64(file) {
    return new Promise((resolve, reject) => {
        const reader = new FileReader();
        reader.readAsDataURL(file);
        reader.onload = () => resolve(reader.result);
        reader.onerror = error => reject(error);
    });
}

class PicturesWall extends Component {

    static propTypes = {
        imgs: PropTypes.array
    }

    constructor(props) {
        super(props);
        let fileList = []
        const {imgs} = this.props
        if (imgs && imgs.length > 0) {
            fileList = imgs.map((i, index) => ({
                uid: -index,//id指定为负数
                name: i,
                status: 'done',//上传done uploading removed
                url: BASE_IMG_URL + i,
                //    response
            }))
        }
        this.state = {
            previewVisible: false,//标识是否弹出大图预览界面Modal
            previewImage: '',
            previewTitle: '',
            fileList,
            // [
            // {
            //     uid: '-1',//id指定为负数
            //     name: 'image.png',
            //     status: 'done',//上传done uploading removed
            //     url: 'https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png',
            //     //    response
            // },
            // {
            //     uid: '-xxx',
            //     percent: 50,
            //     name: 'image.png',
            //     status: 'uploading',
            //     url: 'https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png',
            // },
            // ],
        };
    }

    handleCancel = () => this.setState({previewVisible: false});

    handlePreview = async (file) => {
        console.log('file', file)
        /*
        {
            "uid": "-1",
            "name": "image.png",
            "status": "done",
            "url": "https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png"
        }
         */
        if (!file.url && !file.preview) {
            file.preview = await getBase64(file.originFileObj);
        }
        //显示指定文件对应的大图
        this.setState({
            previewImage: file.url || file.preview,
            previewVisible: true,
            previewTitle: file.name,
        });
    };

    handleChange = async ({file, fileList}) => {
        // file 当前操作的文件
        // 上传image 前端保存的图片和后端返回的name不一致 上传的是选择文件时候的文件名，response的data是后端起的新名字
        /*
        {
                "uid": "rc-upload-1646019712205-45",
                "lastModified": 1642561498867,
                "lastModifiedDate": "2022-01-19T03:04:58.867Z",
                "name": "免费百度网盘会员.png",
                "size": 97603,
                "type": "image/png",
                "percent": 100,
                "originFileObj": {
                    "uid": "rc-upload-1646019712205-45"
                },
                "status": "done",
                "response": {
                    "status": 0,
                    "data": {
                        "name": "image-1646035057761.png",
                        "url": "http://localhost:5000/upload/image-1646035057761.png"
                    }
                },
                "xhr": {},
                "thumbUrl": "data:image/png;base64,"
            }
         */
        console.log('change')
        console.log(file)
        console.log('changeF')
        console.log(fileList)
        if (file.status === 'done') {
            const result = file.response
            if (result.status === 0) {
                message.success('图片上传成功')
                const {name, url} = result.data
                // const targetFile = fileList.find(f => f.uid === file.uid)
                file = fileList[fileList.length - 1]
                file.name = name
                file.url = url
                this.setState({fileList})//上传过程不断更新
            } else {
                message.error('图片上传失败')
            }
        } else if (file.status === 'removed') {//前台删了
            const result = await reqDeleteImage(file.name);//后台删了
            if (result.status === 0) {
                message.success('图片删除成功')
            } else {
                message.error('图片删除失败')
            }
            this.setState({fileList})//上传过程不断更新
        }
    }

//     "status": 0,
//     "data": {
//         "name": "image-1646033459009.png",
//         "url": "http://localhost:5000/upload/image-1646033459009.png"
//     }
    getImages = () => {
        console.log(this.state.fileList)
        return this.state.fileList.map(f => f.name)
    }


    render() {
        const {previewVisible, previewImage, fileList, previewTitle} = this.state;
        const uploadButton = (
            <div>
                <PlusOutlined/>
                <div style={{marginTop: 8}}>Upload</div>
            </div>
        );
        return (
            <>
                <Upload
                    action="/manage/img/upload"//上传图片到的接口地址
                    accept='image/*' //指定格式
                    listType="picture-card"//上传列表的内建样式，支持三种基本样式 text, picture 和 picture-card
                    name='image' //请求参数名
                    fileList={fileList} //所有已经上传图片文件对象的数组
                    onPreview={this.handlePreview}
                    onChange={this.handleChange}
                >
                    {fileList.length >= 3 ? null : uploadButton}
                </Upload>
                <Modal
                    visible={previewVisible}
                    title={previewTitle}
                    footer={null}
                    onCancel={this.handleCancel}
                >
                    <img alt="example" style={{width: '100%'}} src={previewImage}/>
                </Modal>
            </>
        );
    }
}

export default PicturesWall